import React from "react";
import { useNavigate } from "react-router-dom";

export default function Home() {
  const navigate = useNavigate();
  return (
    <div style={{ padding: 80, fontSize: 24, textAlign: "center" }}>
      Welcome to ATHLETIQ!<br />
      <button onClick={() => navigate("/register")} style={{ margin: 16, fontSize: 20 }}>
        Register
      </button>
      <button onClick={() => navigate("/login")} style={{ margin: 16, fontSize: 20 }}>
        Login
      </button>
    </div>
  );
}
